import {Routes, Route, Link} from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import React from "react";

import Navbar from './components/navbar.component';
import CreateUser from './components/create-user.component';
import Login from './components/login';

import Navbar2 from './components/navbar.component'
// import Button from '../node_modules/react-bootstrap/esm/Button';
// import Button from '../node_modules/@restart/ui/esm/Button';
// import { Button } from '../node_modules/reactstrap/types/index';
// import { Button } from '../node_modules/bootstrap/dist/js/bootstrap';
import { Button } from 'bootstrap';

function App() {

const [user,setUser] = React.useState(null);

async function login(user= null){
  setUser(user);
}

async function logout(){
    setUser(null);
}



  return (

    <div>
    <nav className="navbar navbar-expand navbar-dark bg-dark">
      <a href="/" className="navbar-brand">
        ggggg
      </a>
      <div className="navbar-nav mr-auto">
        <li className="nav-item" >
          { user ? (
            <a onClick={logout} className="nav-link" style={{cursor:'pointer'}}>
              Logout {user.name}
            </a>
          ) : (            
          <Link to={"/login"} className="nav-link">
            Login
          </Link>
          )}

        </li>
      </div>
    </nav>

    <div className="container mt-3">
      <Routes>

        <Route 
          path="/login"
          component={Login}
          // render={(props) => (
          //   <Login {...props} login={login} />
          // )}
        />
      </Routes>
    </div>
  </div>


  );
}

export default App;
